import { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";
import { publicUser } from "../../../../../globals/route-names";
import JobZImage from "../../../../common/jobz-img";
import SectionJobsSidebar1 from "../../sections/jobs/sidebar/section-jobs-sidebar1";
import SectionRecordsFilter from "../../sections/common/section-records-filter";
import SectionPagination from "../../sections/common/section-pagination";
import { loadScript } from "../../../../../globals/constants";

function CandidateGridPage() {
  const _filterConfig = {
    prefix: "Showing",
    type: "Candidates",
    total: "2,150",
    showRange: false,
    showingUpto: "",
  };

  // State for storing candidate data and loading/error states
  const [candidates, setCandidates] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data from the API when the component mounts
    const fetchCandidates = async () => {
      try {
        const response = await fetch("http://localhost:8080/candidate");
        if (!response.ok) {
          throw new Error("Failed to fetch candidates");
        }
        const data = await response.json();
        setCandidates(data); // Store fetched data in the state
        setLoading(false); // Set loading to false
      } catch (err) {
        setError(err.message); // Handle error
        setLoading(false); // Set loading to false
      }
    };

    fetchCandidates();

    loadScript("js/custom.js"); // Load custom JS (optional, based on your requirement)
  }, []);

  if (loading) {
    return <div>Loading...</div>; // Show loading indicator while fetching
  }

  if (error) {
    return <div>Error: {error}</div>; // Show error message if fetch fails
  }

  return (
    <div className="section-full p-t120 p-b90 site-bg-white">
      <div className="container">
        <div className="row">
          <div className="col-lg-4 col-md-12 rightSidebar">
            <SectionJobsSidebar1 />
          </div>
          <div className="col-lg-8 col-md-12">
            {/* Filter Short By */}
            <SectionRecordsFilter _config={_filterConfig} />

            <div className="twm-candidates-grid-wrap">
              <div className="row">
                {candidates.map((candidate, index) => (
                  <div key={index} className="col-lg-6 col-md-6">
                    <div className="twm-candidates-grid-style1 mb-5">
                      <div className="twm-media">
                        <div className="twm-media-pic">
                          <JobZImage src={`http://localhost:8080/uploads/candidate/profile/1734326845636-OIP.jpg`} alt={candidate.name} />
                        </div>
                        <div className="twm-candidates-tag">
                          <span>Featured</span>
                        </div>
                      </div>
                      <div className="twm-mid-content">
                        <NavLink
                          to={publicUser.candidate.DETAIL1}
                          className="twm-job-title"
                        >
                          <h4>{candidate.name}</h4>
                        </NavLink>
                        <p>{candidate.position}</p>
                        <NavLink
                          to={publicUser.candidate.DETAIL1}
                          className="twm-view-prifile site-text-primary"
                        >
                          View Profile
                        </NavLink>
                        <div className="twm-fot-content">
                          <div className="twm-left-info">
                            <p className="twm-candidate-address">
                              <i className="feather-map-pin" />
                              {candidate.location}
                            </p>
                            <div className="twm-jobs-vacancies">
                              {candidate.rate}
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            {/* Pagination Section */}
            <SectionPagination />
          </div>
        </div>
      </div>
    </div>
  );
}

export default CandidateGridPage;
